Short Description:
Hook & Barrel is a print and digital lifestyle publication dedicated to the modern outdoorsman. Every issue features the latest trends, gear and lifestyle accessories, plus reviews and educational tools. The gear and accessories Hook & Barrel covers goes beyond the typical products seen in other outdoor sporting magazines. Everything from watches and survival equipment, to vehicles, 4 wheelers and boats that appeal to the modern outdoorsman will be covered.

Hook & Barrel also includes celebrity interviews, food and drink recipes, travel destinations and music spotlights all tying back to the outdoors. Readers will be up to date on all the ‘life' the outdoor lifestyle provides between the hunting and fishing trips. Look for us at Bass Pro Shops and Cabela's or subscribe at www.hookandbarrel.com !

